def apply(self, other):
    if isinstance(other, timedelta):
        return other + self.n * timedelta(minutes=60)

    if isinstance(other, datetime):
        other = datetime(
            other.year,
            other.month,
            other.day,
            other.hour,
            other.minute,
            other.second,
            other.microsecond,
        )

        n = self.n

        if other.time() in self.end or not self._is_on_offset(other):
            other = self._next_opening_time(other)

        businesshours = sum(
            self._get_business_hours_by_sec(st, en)
            for st, en in zip(self.start, self.end)
        )

        bd, r = divmod(abs(n * 60), businesshours // 60)
        if n < 0:
            bd, r = -bd, -r

        skip_bd = BusinessDay(n=bd) if bd != 0 else timedelta(0)
        other += skip_bd

        if other.time() == self._prev_opening_time(other).time() or other.time() == self._next_opening_time(other).time():
            other = skip_bd
        else:
            bhour_remain = timedelta(minutes=r)
            while bhour_remain != timedelta(0):
                if n < 0:
                    bhour = self._next_opening_time(other) - other
                    if bhour_remain < bhour:
                        other += bhour_remain
                        bhour_remain = timedelta(0)
                    else:
                        bhour_remain -= bhour
                        other = self._get_closing_time(
                            self._next_opening_time(other + bhour - timedelta(seconds=1))
                        )
                else:
                    bhour = self._get_closing_time(self._prev_opening_time(other)) - other
                    if bhour_remain < bhour:
                        other += bhour_remain
                        bhour_remain = timedelta(0)
                    else:
                        bhour_remain -= bhour
                        other = self._next_opening_time(other + bhour)

        return other

    raise ApplyTypeError("Only know how to combine business hour with datetime")
